function httpRequest(url, name, callback) {
    var xhr = new XMLHttpRequest();
    xhr.open("POST", url, true);
    xhr.onreadystatechange = function () {
        if (xhr.readyState == 4) {
            callback(xhr.responseText);
        }
    }
    var params = "xing=刘&ming=" + name + "&nian=2016&yue=12&ri=15&hh=0&mm=0&submit=立即测算";
//Send the proper header information along with the request
    xhr.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
    xhr.setRequestHeader("Content-length", params.length);
    xhr.setRequestHeader("Connection", "close");
    xhr.send(params);
}

function save(name) {
    var dataBase = openDatabase("names", "1.0", "起名", 1024 * 1024, function () {
    });
    if (!dataBase) {
        alert("数据库创建失败！");
    } else {
        dataBase.transaction(function (tx) {
            tx.executeSql(
                "CREATE TABLE IF NOT EXISTS name (name TEXT UNIQUE)",
                [],
                function (tx, result) {

                    dataBase.transaction(function (tx) {
                        tx.executeSql(
                            "insert into name (name) values(?)",
                            [name],
                            function () {
                                // alert('添加数据成功');
                                doNext();
                            },
                            function (tx, error) {
                                alert('添加数据失败: ' + error.message);
                            });
                    });
                },
                function (tx, error) {
                    alert('创建stu表失败:' + error.message);
                });
        });
    }
}
function getNameScore(nameAll) {
    var name = nameAll.substring(0, 2);
    httpRequest('http://ceming.yw11.com/ceming.asp', name, function (htmlStr) {

        var start = htmlStr.indexOf('"pf"') + 5;
        var end = start + 6;
        var tmp = htmlStr.substring(start, end);
        end = start + tmp.indexOf("分");
        document.getElementById('ip_div').innerText = "刘" + nameAll + htmlStr.substring(start, end);
        save("刘" + nameAll + htmlStr.substring(start, end))
    });
}
